    false,nt"url": null,nt"notes": "NODC Accession 0104392 includes profile
    and physical data collected aboard the OCEANUS during cruise OC333 in the North
    Atlantic Ocean from 1998-11-16 to 1998-11-20. These data include SALINITY, HYDROSTATIC
    PRESSURE and TEMPERATURE. The instruments used to collect these data include CTD.
    These data were collected by Richard Limeburner of Woods Hole Oceanographic Institution
    as part of GB. The Biological and Chemical Oceanography Data Management Office (BCO-DMO)
    submitted these data to NODC on 2013-01-23.nnThe following is the text of the abstract
    provided by BCO-DMO:nnCTD Data from Mooring Cruise Oceanus 333nnContributor:nRichard
